import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';

// Import components
import Login from './components/auth/Login';
import Signup from './components/auth/Signup';
import AdminDashboard from './components/admin/AdminDashboard';
import MemberDashboard from './components/member/MemberDashboard';
import Members from './components/Members';
import Events from './components/Events';
import Attendance from './components/Attendance';
import Navbar from './components/layout/Navbar';

function App() {
  const [auth, setAuth] = useState(null);

  useEffect(() => {
    // Check if user is logged in
    const user = localStorage.getItem('user');
    if (user) {
      setAuth(JSON.parse(user));
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('user');
    setAuth(null);
    window.location.href = '/login';
  };

  // Protected Route Component
  const ProtectedRoute = ({ children, allowedRoles }) => {
    if (!auth) {
      return <Navigate to="/login" />;
    }
    
    if (allowedRoles && !allowedRoles.includes(auth.role)) {
      return <Navigate to="/" />;
    }
    
    return children;
  };

  return (
    <Router>
      <div className="App">
        {auth && <Navbar auth={auth} onLogout={handleLogout} />}
        
        <Routes>
          {/* Public Routes */}
          <Route path="/login" element={
            auth ? <Navigate to={auth.role === 'Admin' ? '/admin/dashboard' : '/member/dashboard'} /> : <Login setAuth={setAuth} />
          } />
          <Route path="/signup" element={<Signup />} />
          
          {/* Admin Routes */}
          <Route path="/admin/dashboard" element={
            <ProtectedRoute allowedRoles={['Admin']}>
              <AdminDashboard />
            </ProtectedRoute>
          } />
          <Route path="/admin/members" element={
            <ProtectedRoute allowedRoles={['Admin']}>
              <Members />
            </ProtectedRoute>
          } />
          <Route path="/admin/events" element={
            <ProtectedRoute allowedRoles={['Admin']}>
              <Events />
            </ProtectedRoute>
          } />
          <Route path="/admin/attendance" element={
            <ProtectedRoute allowedRoles={['Admin']}>
              <Attendance />
            </ProtectedRoute>
          } />
          
          {/* Member Routes */}
          <Route path="/member/dashboard" element={
            <ProtectedRoute allowedRoles={['Member', 'Director']}>
              <MemberDashboard />
            </ProtectedRoute>
          } />
          <Route path="/member/events" element={
            <ProtectedRoute allowedRoles={['Member', 'Director']}>
              <Events />
            </ProtectedRoute>
          } />
          <Route path="/member/attendance" element={
            <ProtectedRoute allowedRoles={['Member', 'Director']}>
              <Attendance />
            </ProtectedRoute>
          } />
          
          {/* Default Route */}
          <Route path="/" element={
            auth ? (
              auth.role === 'Admin' ? 
                <Navigate to="/admin/dashboard" /> : 
                <Navigate to="/member/dashboard" />
            ) : (
              <Navigate to="/login" />
            )
          } />
          
          {/* Catch all route */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
